<div class="header"><?php include("header.php"); ?></div><h1>MultiCCAligned v1.1</h1>This corpus was created from 68 Commoncrawl Snapshots (up until March 2020). The documents are split into sentences based on punctuations and deduplication is performed. No claims of intellectual property are made on the work of preparation of the corpus. The original distribution is available from <a href="http://www.statmt.org/cc-aligned/">http://www.statmt.org/cc-aligned/</a> <p>CCAligned consists of parallel or comparable web-document pairs in 137 languages aligned with English. These web-document pairs were constructed by performing language identification on raw web-documents, and ensuring corresponding language codes were corresponding in the URLs of web documents. This pattern matching approach yielded more than 100 million aligned documents paired with English. Recognizing that each English document was often aligned to mulitple documents in different target language, we can join on English documents to obtain aligned documents that directly pair two non-English documents (e.g., Arabic-French).</p> <p>Sentence pairs were extracted using similarity scores of LASER embeddings from the document pairs (minimum similarity 1.04, sorted based on decreasing similarity score). It misses some languages not covered by LASER.</p> This collection has been further processed for making it a multi-parallel corpus by <a href="https://www.aclweb.org/anthology/2020.lrec-1.467/">pivoting via English</a>. The original bitexts for English-centric data are available from the <a href="http://opus.nlpl.eu/CCAligned-v1.1.php">CCAligned release</a>. The difference to version 1 is that pivoting now only uses the link with best score in case of alternative alignments for a pivot sentence.<p>112 languages, 6,075 bitexts<br>total number of files: 112<br>total number of tokens: 11.27G<br>total number of sentence fragments: 836.50M<br><p>If you use the dataset or code, please cite (<a href="https://www.aclweb.org/anthology/2020.emnlp-main.480.pdf">pdf</a>): <blockquote><pre> @inproceedings{elkishky_ccaligned_2020,</br> author = {El-Kishky, Ahmed and Chaudhary, Vishrav and Guzm√°n, Francisco and Koehn, Philipp},</br> booktitle = {Proceedings of the 2020 Conference on Empirical Methods in Natural Language Processing (EMNLP 2020)},</br> month = {November},</br> title = {{CCAligned}: A Massive Collection of Cross-lingual Web-Document Pairs},</br> year = {2020}</br> address = "Online",</br> publisher = "Association for Computational Linguistics",</br> url = "https://www.aclweb.org/anthology/2020.emnlp-main.480",</br> doi = "10.18653/v1/2020.emnlp-main.480",</br> pages = "5960--5969"</br> }</pre></blockquote> and, please, acknowledge <a href="https://www.aclweb.org/anthology/L12-1246/">OPUS</a> (<a href="https://www.aclweb.org/anthology/L12-1246.bib">bib</a>, <a href="http://www.lrec-conf.org/proceedings/lrec2012/pdf/463_Paper.pdf">pdf</a>) as well for this service. For more information on the sentence pair mining method, see <a href="https://www.aclweb.org/anthology/W19-5435/">Chaudhary et al., WMT 2019</a> (<a href="https://www.aclweb.org/anthology/W19-5435.bib">bib</a>, <a href="https://www.aclweb.org/anthology/W19-5435.pdf">pdf</a>). Pivoting is done using OpusTools, see <a href="https://www.aclweb.org/anthology/2020.lrec-1.467/">Aulamo et al., LREC 2020</a> (<a href="https://www.aclweb.org/anthology/2020.lrec-1.467.bib">bib</a>, <a href="https://www.aclweb.org/anthology/2020.lrec-1.467.pdf">pdf</a>)<h3>Download</h3><p>Below you can download data files for all language pairs in different formats and with different kind of annotation (if available). You can click on the various links as explained below. In addition to the files shown on this webpage, OPUS also provides pre-compiled word alignments and phrase tables, bilingual dictionaries, frequency counts, and these files can be found through the <a href="/index.php">resources search form on the top-level website of OPUS</a>.</p><p></p><h3>Release history:</h3><p><ul><li><a href="MultiCCAligned-v1.php">MultiCCAligned v1</a></li></ul></p><table><tr><td>Bottom-left triangle: download files<ul><li><i>ces</i> = sentence alignments in XCES format</li> <li><i>leftmost column language IDs</i> = tokenized corpus files in XML</li> <li>TMX and plain text files (Moses): see "Statistics" below</li> <li><i>lower row language IDs</i> = parsed corpus files (if they exist)</li></ul></td><td>Upper-right triangle: sample files <ul><li><i>view</i> = bilingual XML file samples</li> <li><i>upper row language IDs</i> = monolingual XML file samples</li> <li><i>rightmost column language IDs</i> = untokenized corpus files</li></ul></td></tr></table><p><div class="sample"><table border="0" cellpadding="0">
